import React from 'react';

import axios from 'axios';

export default class statusList extends React.Component {
  state = {
    status: []
  }

  componentDidMount() {
    axios.get('https://kctbh9vrtdwd.statuspage.io/api/v2/components.json')
      .then(res => {
        const status = res.data;
        this.setState({ status });
      })
  }

  render() {
    return (
      <ul>
        { this.state.status.map(person => <li>{status.name}</li>)}
      </ul>
    )
  }
}
